import React from 'react';
import './HomePage.css'; // CSS dosyasını ekleyin

const HomePage: React.FC = () => {
  return (
    <div className="homepage-container">
      <h1 className="homepage-title">Hoşgeldiniz!</h1>
      <p className="homepage-subtitle">Ne İzlemek İstersiniz?</p>
      <div className="button-container">
        <button className="choice-button dizi">Dizi</button>
        <button className="choice-button film">Film</button>
      </div>
      <div className="favorites-container">
        <h2 className="favorites-title">Favori Listeniz</h2>
        <div className="cards-container">
          <div className="card">
            <p className="card-name">Breaking Bad</p>
            <div className="card-hover">
              <p>Favorilerinizde</p>
            </div>
          </div>
          {/* Daha fazla kart eklenebilir */}
        </div>
      </div>
    </div>
  );
};

export default HomePage;
